                fill: false,
                steppedLine: 'before',
            }]
        },
        options: {
            scales: {
                xAxes: [{
                    type: 'linear',
                    position: 'bottom'
                }]
            },
            elements: {
                line: {
                    tension: 0 // disables bezier curves
                }
            }
        },
    };

    window.onload = function() {
        var ctx = document.getElementById('canvas').getContext('2d');
        window.myBar = new Chart(ctx, config);

    };
</script>
</body>
</html>
